[[Baalzebub]] {{msl|Baalzebub}}, a [[ghost]] {{msl|ghost}}, a [[horned devil]] {{msl|horned devil}} and a [[barbed devil]] {{msl|barbed devil}} are in the central complex at the positions shown above.

Additionally the following are scattered randomly around the level:

* four random pieces of [[armor]]
* four random [[weapon]]s
* three random [[gem]]s or [[stone]]s
* four random [[potions]]
* four random [[scrolls]]
* two [[spiked pit]]s
* two [[fire trap]]s
* two [[sleeping gas trap]]s
* two [[anti-magic field]]s
* three [[rust trap]]s
* four [[magic trap]]s
* a random [[lich|{{gray|L}}]]
* two [[ghost]]s
* one or two [[shade]]s
* two random [[&|{{gray|&}}]]
* three or four [[horned devil]]s
* four or five [[lemure]]s
* three random [[vampire|{{gray|V}}]]
* three random [[F|{{gray|F}}]]
* a [[green slime]] named "Glurrz, emissary of [[Juiblex]]"
* two or three random [[P|{{gray|P}}]]

All of the walls are non-diggable. Most of the level is unlit except the area around the upstair.

== Strategy ==

In theory, one could get through the level without a means of crossing water, by walking carefully on the solid floor tiles and opening the drawbridge with a [[wand of opening]]. However that is not necessarily practical.

